script: |
  super -f text -I q9543.spq | sort > q9543.out

inputs:
  - name: q9543.spq
    data: |
      SELECT DISTINCT 8 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT NULL BETWEEN 22 + + - 63 AND ( - col0 * - - 36 / + 82 + - 83 * + 22 );
  - name: tab2

outputs:
  - name: q9543.out
    data: |
